import React from 'react';
import Navbar from './StaffNavbar';
import { useStaff } from './StaffContext'; // Import useStaff hook to access context

const StaffHomepage = () => {
  const { state } = useStaff(); // Get state from context

  // Destructure relevant information from state
  const { stfUserName, staffData, stfStaffType } = state;

  return (
    <div className="flex-1 flex flex-col overflow-hidden">
      <Navbar />
      <main className="flex-1 overflow-x-hidden overflow-y-auto bg-gray-200">
        <div className="m-auto p-8 bg-white rounded shadow-md">
          <h1 className="text-3xl font-bold mb-4">Staff Homepage</h1>
          <div className="flex justify-between">
            <div className="w-1/2 p-4">
              <h2 className="text-xl font-semibold mb-2">Donor Management</h2>
              {/* Display staff-related information */}
              <p>Username: {stfUserName}</p>
              <p>Staff Name: {staffData.staffName}</p> {/* Assuming staffName is a property in staffData */}
              <p>Staff Type: {stfStaffType}</p>
            </div>
            <div className="w-1/2 p-4">
              <h2 className="text-xl font-semibold mb-2">Reports</h2>
              {/* Add Reports-related content or links */}
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default StaffHomepage;
